import {useEffect, useState} from "react";
import { useContext } from "react";

import { ZodiacSignsDetail } from "./data";

import { BrowserRouter, Route, Router, Routes } from 'react-router-dom';
//import Zodiac from "./zodiac";

import "./index.css";
const url ="https://raw.githubusercontent.com/sannlynnhtun-coding/Zodiac/main/Zodiac.json";


function Card(){

const name = ZodiacSignsDetail;



 
  return(

       <div className="container">  
    
    <ul className="users">
      {ZodiacSignsDetail.map((ZodiacSignsDetail)=>{
          return(
              <li>
             <img  id='logo' src={ZodiacSignsDetail.ZodiacSignImageUrl } alt={name.ZodiacSignImageUrl}/>
                  <div>
                     <h4>{ZodiacSignsDetail.Name}</h4> 
                     <h4>{ZodiacSignsDetail.MyanmarMonth}</h4> 
                     <h6>{ZodiacSignsDetail.Dates}</h6>
                                          
                  </div>
              </li>
          )
      })}
    </ul>
    
   </div>
   
   
  );
}
export default Card;
